import React from 'react';

const Header = () => {
    return (
        <div className="container-fluid"> 
         <div className="p-5 text-center bg-light"></div>
            <h2>Developer Challenge</h2>
            <h6>By <a href="https://linkedin.com/in/julie-exel" rel="noreferrer" title="View My LinkedIn" >Julie Exel</a></h6>
        </div>
    )
}
  

export default Header;
